    <li> <strong> Artigos completos </strong> (at 10 pginas), apresentando um resultado de interesse para o avano da pesquisa na rea.
    Artigos que descrevem modelos, mtodos, estudos experimentais e relatos de experincia industriais so bem-vindos;e,</li> 
